// src/components/MovieList.js
import React from "react";

const MovieList = ({ movies }) => {
  return (
    <table>
      <thead>
        <tr className="indexContainer">
          <th>연도</th>
          <th>영화제목</th>
          <th>대사</th>
          <th>배우</th>
          <th>감독</th>
          <th>원작</th>
          <th>각본</th>
          <th>각색</th>
          <th>클립영상</th>
          <th>해설</th>
        </tr>
      </thead>
      <tbody>
        {movies.map((movie) => (
          <tr key={movie.id}>
            <td>{movie.year}</td>
            <td>{movie.title}</td>
            <td>{movie.dialogue}</td>
            <td>{movie.actor}</td>
            <td>{movie.director}</td>
            <td>{movie.source}</td>
            <td>{movie.scenario}</td>
            <td>{movie.adaptation}</td>
            <td>{movie.clip}</td>
            <td>{movie.commentary}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};
export { MovieList as movies };

export default MovieList;
